import React from "react";
import { Navigate } from "react-router-dom";

export default function Home() {
  const Login = () => {
    localStorage.removeItem('tokenEddit');
    Navigate('/login') 
  }

  return (
    <div>
      <h1>Sou a Home</h1>
      <button onClick={Login}>Entrar</button>
    </div>
  );
}
